"use strict";(self.webpackChunkkevingrondin=self.webpackChunkkevingrondin||[]).push([[4578],{5728:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"dons","metadata":{"permalink":"/wiki/blog/dons","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-06-01-dons/index.mdx","source":"@site/blog/2022-06-01-dons/index.mdx","title":"Dons","description":"Hello mes chers amis d\xe9veloppeurs de l\'extr\xeame.","date":"2022-06-01T00:00:00.000Z","formattedDate":"June 1, 2022","tags":[{"label":"green","permalink":"/wiki/blog/tags/green"}],"readingTime":0.475,"hasTruncateMarker":false,"authors":[{"name":"Kevin Grondin","title":"Admin","url":"https://github.com/kevingrondin","imageURL":"https://avatars.githubusercontent.com/u/6604220?v=4","key":"kevin"}],"frontMatter":{"slug":"dons","title":"Dons","authors":["kevin"],"tags":["green"]},"nextItem":{"title":"Closer","permalink":"/wiki/blog/closer"}},"content":"Hello mes chers amis d\xe9veloppeurs de l\'extr\xeame.\\n\\nNous avons la plupart d\'entre nous un PC non utilis\xe9, qu\'on aurait voulu utiliser pour faire un serveur.\\nR\xe9parer pour quelqu\'un de la famille ou autre.\\nMais par manque de temps, il reste chez nous, et on s\'encombre pour rien.\\n\\nIl est temps de se dire la v\xe9rit\xe9 que ce PC n\'aura pas une seconde vie avec nous et il est temps d\'en faire dons.\\n\\n```mdx-code-block\\nimport LiteYouTubeEmbed from \'react-lite-youtube-embed\';\\n\\n<div className=\\"video-container\\">\\n  <LiteYouTubeEmbed\\n    // cSpell:ignore Yhyx Sksg\\n    id=\\"Nxva5Rj1nJM\\"\\n    adNetwork={true}\\n    params=\\"autoplay=1&autohide=1&showinfo=0&rel=0\\"\\n    title=\\"Reportage: Association agame\\"\\n    poster=\\"hqdefault\\"\\n    noCookie={true}\\n  />\\n</div>\\n```"},{"id":"closer","metadata":{"permalink":"/wiki/blog/closer","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-05-17-closer/index.md","source":"@site/blog/2022-05-17-closer/index.md","title":"Closer","description":"Hello mes chers amis d\xe9veloppeurs de l\'extr\xe8me.","date":"2022-05-17T00:00:00.000Z","formattedDate":"May 17, 2022","tags":[{"label":"freelance","permalink":"/wiki/blog/tags/freelance"}],"readingTime":1.31,"hasTruncateMarker":false,"authors":[{"name":"Kevin Grondin","title":"Admin","url":"https://github.com/kevingrondin","imageURL":"https://avatars.githubusercontent.com/u/6604220?v=4","key":"kevin"}],"frontMatter":{"slug":"closer","title":"Closer","authors":["kevin"],"tags":["freelance"]},"prevItem":{"title":"Dons","permalink":"/wiki/blog/dons"},"nextItem":{"title":"Bienvenue","permalink":"/wiki/blog/bienvenue"}},"content":"Hello mes chers amis d\xe9veloppeurs de l\'extr\xe8me.\\n\\nPremier article il fallait donc commencer par du tr\xe8s lourd \ud83d\ude0e.\\n\\nIl peut arriver en temps que d\xe9veloppeur, d\'avoir des propositions de r\xe9alisation de site web, d\'audit, d\'applications, etc ... .\\n \\nC\'est pourquoi je d\xe9cide de partager avec vous des templates de mails, ou de message pour vous aider \xe0 vous d\xe9marquer.\\n\\n:::success mail de r\xe9ponse\\n __Demande de {{prenom}} {{entreprise}}__\\n\\nMerci de m\'avoir \xe9crits et de m\'avoir fait part de votre int\xe9r\xeat pour {{mon_entreprise}}\\n\\nAfin de m\'assurer de comprendre tout les informations \xe0 votre situation, je vous propose quelque questions afin d\'obtenir un peu de contexte.\\n\\nPouvez-vous me donner une id\xe9e de ce que vous cherchez \xe0 accomplir avec ce projet pour {{entreprise}} ?\\n\\nY\'a t\'il des exigences particuli\xe8res, en mati\xe8re de __visibilit\xe9__ ( r\xe9f\xe9rencement ), de __s\xe9curit\xe9__, de __maintenance__, __monioring__, __d\xe9ploiement__, __contre-rendus__, __personnalisation__, de __gestion de projet__, et les __imperatifs__ ?\\n\\nPouvez-vous confirmer le nombre total de personnes qui vont travailler sur ce projet, et qui travail avec vous ?\\n\\nEt surtout, dans combien de temps vous souhaiteriez commencer le projet ?\\n\\nMerci pour votre temps, je suis impatient d\'avoir de vos nouvelles !\\n{{mon_prenom}}\\n:::\\n\\n:::caution relance au bout de 6 jours\\n__Re: Demande de {{prenom}} {{entreprise}}__\\n\\nJ\'esp\xe8re que vous vous portez bien, Suite \xe0 votre message, sur la fa\xe7on dont je pourrais vous aider de mani\xe8re transparante.\\n\\nSouhaitez-vous toujours en savoir plus ou avez-vous choisi une autre option pour le moment ?\\n\\nN\'h\xe9sitez pas \xe0 me le faire savoir afin  que je ne continue pas \xe0 encombre votre boite de r\xe9ception.\\n:::"},{"id":"bienvenue","metadata":{"permalink":"/wiki/blog/bienvenue","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2022-05-12-bienvenue/index.md","source":"@site/blog/2022-05-12-bienvenue/index.md","title":"Bienvenue","description":"J\'ai d\xe9cid\xe9 de commencer en 2022 un nouveau blog, un peu en retard sachant qu\'on est en mai \ud83d\ude0f","date":"2022-05-12T00:00:00.000Z","formattedDate":"May 12, 2022","tags":[{"label":"hello","permalink":"/wiki/blog/tags/hello"}],"readingTime":0.175,"hasTruncateMarker":false,"authors":[{"name":"Kevin Grondin","title":"Admin","url":"https://github.com/kevingrondin","imageURL":"https://avatars.githubusercontent.com/u/6604220?v=4","key":"kevin"}],"frontMatter":{"slug":"bienvenue","title":"Bienvenue","authors":["kevin"],"tags":["hello"]},"prevItem":{"title":"Closer","permalink":"/wiki/blog/closer"}},"content":"J\'ai d\xe9cid\xe9 de commencer en 2022 un nouveau blog, un peu en retard sachant qu\'on est en mai \ud83d\ude0f\\n\\nTout la documentation et la partie blog est r\xe9alis\xe9 avec un simple outil [Docusaurus](https://docusaurus.io/)\\n\\n![Docusaurus Plushie](./docusaurus-plushie-banner.jpeg)"}]}')}}]);